/** @jsx jsx */
/** @jsxRuntime classic */
import { css, jsx } from "@emotion/core";
import navLogo from "../../navLogo.svg";
import logo from "../logo.png";


const HeroNavLogo = () => <a href="/"> <h2 css={styles} src="">movieverse</h2> <img className="Logo" alt="" src={logo}/> </a> 

const styles = css`
    font-size: 22px;
    font-weight: 800;
    margin-right: 140px;
    user-select: none;

`;

export default HeroNavLogo;
